import React from 'react';
import Link from 'next/link';

const NewHeader: React.FC = () => (
  <div>
    <Link href="/">
      <div as="a">Simple Blog</div>
    </Link>
    <Link href="/posts/new">
      <button>Create a new Post</button>
    </Link>
  </div>
);

export default NewHeader;
